function GetRandomInList(OneList){
    return OneList[Math.floor(Math.random() * OneList.length)];
}

function GetBirthDate(Age){
    // Return today's date and time
    var currentTime = new Date()
    // returns the year (four digits)
    var year = currentTime.getFullYear()-Age
    let Month = Math.floor(Math.random()*11.99 + 1)
    let Day = 0
    if(Month == 2){                                 Day = Math.floor(Math.random()*28);}
    else if([01,03,05,07,08,10,12].includes(Month)){Day = Math.floor(Math.random()*31);}
    else{                                           Day = Math.floor(Math.random()*30);}

    return year+"-"+pad(Month,2)+"-"+pad(Day,2)
}

function pad(num,len){
    return String(num).padStart(len, '0');
}

function clean(text){
    return text.normalize("NFD").replace(/[\u0300-\u036f]/g, "").replace(" ","_")
}

function GetEmail(Name,Firstname,DoB,ZIP){
    let Randomizer = Math.floor(Math.random() * 100)
    if(Randomizer<20){
        return clean(Firstname)+"."+clean(Name)+"@"+GetRandomInList(ValuesLists.eMailDomains);
    }else if(Randomizer<40){
        return clean(Name)+"."+clean(Firstname)+"@"+GetRandomInList(ValuesLists.eMailDomains);
    }else if(Randomizer<50){
        return clean(Name)+"."+Firstname[0]+"@"+GetRandomInList(ValuesLists.eMailDomains);
    }else if(Randomizer<60){
        return clean(Name)+"."+clean(Firstname)+"."+ZIP+"@"+GetRandomInList(ValuesLists.eMailDomains);
    }else if(Randomizer<80){
        return clean(Name)+"."+clean(Firstname)+"."+DoB.substring(0, 4)+"@"+GetRandomInList(ValuesLists.eMailDomains);
    }else if(Randomizer<100){
        return clean(Name).substring(0, 2)+"."+clean(Firstname)+"-"+ZIP+"@"+GetRandomInList(ValuesLists.eMailDomains);
    }
}

function GetPhone(){
    //For casualities, only mobile phone number (they are geographicaly linked)
    let Randomizer = Math.floor(Math.random() * 100)
    let PhoneNumber = "0"
    if(Randomizer<35){
        PhoneNumber+="7"
    }else{
        PhoneNumber+="6"
    }
    PhoneNumber+=pad(Math.floor(Math.random() * 100),2)
    PhoneNumber+=pad(Math.floor(Math.random() * 100),2)
    PhoneNumber+=pad(Math.floor(Math.random() * 100),2)
    PhoneNumber+=pad(Math.floor(Math.random() * 100),2)
    return PhoneNumber
}

function GetPassword(length){
    return new Array(length).fill("0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz$-_£%!?.:!").map(x => (function(chars) { let umax = Math.pow(2, 32), r = new Uint32Array(1), max = umax - (umax % chars.length); do { crypto.getRandomValues(r); } while(r[0] > max); return chars[r[0] % chars.length]; })(x)).join('');
}

function Get_SSN(Gender,Dob){
    let SSN = ""
    //Gender
    if(Gender=="M"){
        SSN+="1"
    }else{
        SSN+="2"
    }
    //BirthYear 2 Digit
    SSN+=Dob.substring(2,4)
    //Month of Bird
    SSN+=Dob.substring(5,7)
    //Birth Aread
    SSN+=pad(Math.floor(Math.random() * 94)+1,2)
    // 6 Random Digit
    SSN+=pad(Math.floor(Math.random() * 999)+1,3)
    SSN+=pad(Math.floor(Math.random() * 999)+1,3)
    // KEy
    SSN += ""+ (97 - (SSN+1-1) % 97)
    return SSN
}

